import ExpenseItem from "./ExpenseItems";
import './Expenses.css'
const Expenses = (props) => {
    return (
        <div className="expenses">
            {props.item.map((expense)=>{<ExpenseItem title={expense.title} date={expenses.date} amount={expenses.amount} />})}
            
        </div>
    )
}

export default Expenses;
